caption.text:
I thank God for all the moments we spent together;
for those late nights and early mornings,
for every single receh jokes and our ringing laughter,
for the exercises we do on a daily basis (ehm, @pritn @nataliajulianti @rindachristnk),
for the "Masak Yuk" show and "sepatu ulekan gado-gado",
for all those random songs we sang and weird dance movements we made,
and for another million little things you guys did that made me smile.
Proficiat, MSC DBC Concert XI! I'll see you in some other chance üòä
